import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import CameraIcon from '@material-ui/icons/PhotoCamera';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Link from '@material-ui/core/Link';
import AudioCard from "audiocard"
import "./sample.css"

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://material-ui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles(theme => ({
  icon: {
    marginRight: theme.spacing(2),
  },
  heroContent: {
    backgroundColor: theme.palette.background.paper,
    padding: theme.spacing(8, 0, 6),
  },
  heroButtons: {
    marginTop: theme.spacing(4),
  },
  cardGrid: {
    paddingTop: theme.spacing(8),
    paddingBottom: theme.spacing(8),
  },
  card: {
    height: '100%',
    display: 'flex',
    flexDirection: 'column',
  },
  cardMedia: {
    paddingTop: '56.25%', // 16:9
  },
  cardContent: {
    flexGrow: 1,
  },
  footer: {
    backgroundColor: "black",
    padding: theme.spacing(6),
  },
}));

const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];

export default function Album() {
  const classes = useStyles();

  return (
    <React.Fragment>
      <CssBaseline />
      <AppBar position="relative">
        <Toolbar>
          <CameraIcon className={classes.icon} />
          <Typography variant="h6" color="inherit" noWrap>
            Album layout
          </Typography>
        </Toolbar>
      </AppBar>
      <main>
        {/* Hero unit */}
        <div className={classes.heroContent}>
          <Container maxWidth="sm">
            <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
              Your Playlist
            </Typography>
            <Typography variant="h5" align="center" color="textSecondary" paragraph>
                Here is some tracks for you to enjoy. Don't like what you hear? Don't worry, you can add your own taste
                of music.
            </Typography>
            <div className={classes.heroButtons}>
              <Grid container spacing={2} justify="center">
                <Grid item>
                  <Button variant="contained" color="primary">
                    Add your own music
                  </Button>
                </Grid>
                <Grid item>
                  <Button variant="outlined" color="primary">
                    Link your spotify
                  </Button>
                </Grid>
              </Grid>
            </div>
          </Container>
        </div>
        <Container className={classes.cardGrid} maxWidth="md">
          {/* End hero unit */}
          <div style={{width: 500,overflow: 'hidden'}}>
            <AudioCard 
            className="audiocard"
            title="Ep 1. - What is Criminal Justice?"
            art="https://seekjustice.fm/art300.jpg"
            source="https://dts.podtrac.com/redirect.mp3/seekjustice.fâ¦"
            skipBackSeconds={10}
            skipForwardSeconds={30}
            />
            <AudioCard
            className="audiocard"
            title="Ep 1. - What is Criminal Justice?"
            art="https://seekjustice.fm/art300.jpg"
            source="https://dts.podtrac.com/redirect.mp3/seekjustice.fâ¦"
            skipBackSeconds={10}
            skipForwardSeconds={30}
            />
            <AudioCard
            className="audiocard"
            title="Ep 1. - What is Criminal Justice?"
            art="https://seekjustice.fm/art300.jpg"
            source="https://dts.podtrac.com/redirect.mp3/seekjustice.fâ¦"
            skipBackSeconds={10}
            skipForwardSeconds={30}
            />
            </div>
        </Container>
      </main>
      {/* Footer */}
      <footer className={classes.footer}>
        <Typography variant="h6" align="center" gutterBottom>
          Footer
        </Typography>
        <Typography variant="subtitle1" align="center" color="textSecondary" component="p">
          Something here to give the footer a purpose!
        </Typography>
        <Copyright />
      </footer>
      {/* End footer */}
    </React.Fragment>
  );
}
